import React from 'react';
import {Button, Card, Col, Image} from "react-bootstrap";
import {BOXPAGE_ROUTE} from "../utils";
import {useNavigate} from "react-router-dom";

const BoxTopList = ({boxes}) => {

    const navigate = useNavigate()
    console.log('BoxTopList')
    return (
        <div>
            {boxes.map(box => <div key={box.box.id}>
                <Card
                    onClick={()=> navigate(BOXPAGE_ROUTE +'/' + box.box.id)}
                    key={box.box.id}
                    style={{width:150, cursor:"pointer"}} border={"light"}
                    className="m-2 p-0"
                >
                    <Card.Img
                        variant="top"
                        src={process.env.REACT_APP_API_URL + box.box.img}
                        width={300}
                        height={300}

                    />
                    <Card.Body>
                        <Card.Title>{box.box.name}</Card.Title>
                        <Card.Text>
                            {box.box.price} грн
                        </Card.Text>
                    </Card.Body>
                </Card>
            </div>)}
        </div>
    )
}

export default BoxTopList;
